import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the "Your Profile" link
    // Using .first() as there are multiple links with the same text
    await page.getByRole('link', { name: 'Your Profile' }).first().click();

    // Wait for the profile page content to be visible
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Take a screenshot after navigating to the profile
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract data to verify the action
    const profileName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('.profile-info .username').textContent();

    return {
      success: true,
      action: "Navigated to Jun's Profile",
      extractedData: {
        profileName: profileName.trim(),
        username: username.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // On failure, capture a final screenshot if possible
    try {
      await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
      screenshots.push(path.join(screenshotsDir, 'error.png'));
    } catch (e) {
      // Ignore if screenshot fails
    }
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
